import React from "react";
import IndexNavbar from "components/Navbars/IndexNavbar.js";
import Footerr from "components/Footers/Footerr";

function MyTickets() {
  const tickets = [
    {
      title: "Problème d'accès au portail client",
      department: "Support technique",
      date: "2024-05-19"
    },
    {
      title: "Question sur un virement international",
      department: "Questions bancaires",
      date: "2024-05-14"
    },
    {
      title: "Carte bloquée à l'étranger",
      department: "Carte Bancaire",
      date: "2024-05-10"
    }
  ];

  return (
    <>
      <IndexNavbar />

      <div style={containerStyle}>
        <div style={headerStyle}>
          <img 
            src="/path-to-your-bank-logo.png" 
            alt="3TDBANK" 
            style={logoStyle} 
          />
          <h1 style={titleStyle}>Mes Tickets</h1>
        </div>

        <div style={contentStyle}>
          <div style={ticketListStyle}>
            {tickets.map((ticket, index) => (
              <div key={index}>
                <div style={ticketItemStyle}>
                  <h3 style={ticketTitleStyle}>{ticket.title}</h3>
                  <div style={ticketMetaStyle}>
                    <span style={departmentStyle}>{ticket.department}</span>
                    <span style={dateStyle}>{ticket.date}</span>
                  </div>
                </div>
                {index !== tickets.length - 1 && <hr style={dividerStyle} />}
              </div>
            ))}
          </div>

          <div style={footerSectionStyle}>
            <div style={footerItemStyle}>
              <img src="/path-to-quart-icon.png" alt="Quart" style={iconStyle} />
              <span>Quart</span>
            </div>
            <div style={footerItemStyle}>
              <img src="/path-to-free-icon.png" alt="Gratuit" style={iconStyle} />
              <span>Gratuit</span>
            </div>
          </div>
        </div>
      </div>

      <Footerr />
    </>
  );
}

// Styles
const containerStyle = {
  minHeight: "100vh",
  backgroundColor: "#f5f7fa",
};

const headerStyle = {
  backgroundImage: "linear-gradient(rgba(0,0,0,0.5), rgba(0,0,0,0.5)), url('/path-to-bank-image.jpg')",
  backgroundSize: "cover",
  backgroundPosition: "center",
  color: "white",
  padding: "3rem 1rem",
  textAlign: "center"
};

const logoStyle = {
  width: "150px",
  marginBottom: "1rem"
};

const titleStyle = {
  fontSize: "2rem",
  fontWeight: "300",
  margin: "0"
};

const contentStyle = {
  maxWidth: "800px",
  margin: "2rem auto",
  padding: "0 1rem"
};

const ticketListStyle = {
  backgroundColor: "white",
  borderRadius: "10px",
  boxShadow: "0 2px 8px rgba(0,0,0,0.1)",
  padding: "1rem"
};

const ticketItemStyle = {
  padding: "1.5rem",
};

const ticketTitleStyle = {
  fontSize: "1.1rem",
  color: "#2c3e50",
  margin: "0 0 0.5rem 0"
};

const ticketMetaStyle = {
  display: "flex",
  justifyContent: "space-between",
  alignItems: "center"
};

const departmentStyle = {
  color: "#7f8c8d",
  fontSize: "0.9rem"
};

const dateStyle = {
  color: "#95a5a6",
  fontSize: "0.85rem"
};

const dividerStyle = {
  border: "none",
  borderTop: "1px solid #e0e0e0",
  margin: "0"
};

const footerSectionStyle = {
  display: "flex",
  justifyContent: "space-around",
  marginTop: "2rem",
  padding: "1rem",
  backgroundColor: "white",
  borderRadius: "10px",
  boxShadow: "0 2px 8px rgba(0,0,0,0.1)"
};

const footerItemStyle = {
  display: "flex",
  alignItems: "center",
  gap: "0.5rem",
  color: "#2c3e50"
};

const iconStyle = {
  width: "24px",
  height: "24px"
};

export default MyTickets;
